import { useEffect, useState } from 'react';

const PostFetch = () => {
    const [posts, setPosts] = useState(null);

    useEffect(() => {
        fetch('https://jsonplaceholder.typicode.com/posts')
            .then(res => {
                return res.json();
            })
            .then(resdata => {
                setPosts(resdata);
            })
    }, [])

    const postList = posts.map(post => (
        <div key={post.id}>
            <h3>{post.title}</h3>
            <p>{post.body}</p>
        </div>
    ))

    return (
        <div>
            {postList}
        </div>
    );
}

export default PostFetch;
